    @Test
    public void erroAoSincronizarListaDeEstagio() throws IOException {
        inicioExecucao = new DateTime(2017, 1, 18, 0, 0, 0);

        assertTrue(controlador.isCompleto());

        Motor motor = new Motor(controlador, inicioExecucao, this);

        avancarSegundos(motor, 112);
        acionarModoManual(motor);
        avancarSegundos(motor, 156);
        trocarEstagioModoManual(motor);
        avancarSegundos(motor, 500);


        assertTrue(ativacaoModoManual.get(inicioExecucao.plusSeconds(240)));
        assertEquals(inicioExecucao.plusSeconds(267), listaTrocaManualLiberada.get(0));
    }

